import React, {useState, useEffect} from 'react'
import axios from 'axios'
import getspaceX from '../services/spaceX'
import Box from "@material-ui/core/Box";
import FilterCards from './filter_card'
import Cards from './cards'


export default () => {
    console.log(getspaceX)
    const [launch_success , setlaunchSuccess] = useState(false)
    const [year , setYear] = React.useState([])
    useEffect(() => {
        fetch(getspaceX)
          .then(response => response.json())
          .then(jsonResponse => {
            // setlaunchSuccess(jsonResponse.Search);
            setlaunchSuccess(true);
          });
      }, []);
      const handleSuccessful_Launch =() =>{
alert("coming")
      }
    return(
        <Box display="flex" p={1}>
            {
                launch_success.map((item =>(
                    <FilterCards value={item} onClick={handleSuccessful_Launch}/>
                )))
            }
            
            <Cards/>
        </Box>
    )
   
}
